import './Person'
const Person = (props) => {
  const data = props.data;
  const content = data.categoriesCollection.items.map((item) => (
    <p>{item.displayName}</p>
  ));
  return (
    <div>
      <h1 style='center'>{data.displayName}</h1>
      {content}
    </div>
  );
};
export default Person;
